aster13_teaser','','This line brings flowers, teleports and a couple of eggs with it. Check out the floral-inspired line below!','','','',0,''),(381,374,'2014_lagomorph_','2014 - Lagomorph ','default_3x3',1,181,1,6,'1','1','0','0','catalog_header_easter14_001','easternew','','From shape shifting wall pieces to cryptic teleports, this years Easter furni line is sure to keep you guessing! Nothing is as it seems on this mind-bending island...','','','',0,''),(228,219,'how_to_play_freeze','How to Play Freeze!','pets2',1,42,1,4,'1','1','0','0','catalog_freeze_en','ctlg_pet_note','','Find out how you can make and host your own Freeze! game by reading the instructions below!','How to play Freeze!','1. Place Tiles and Blocks in your room. Always place blocks on top of tiles! Add Team Gates, a Counter, an Exit Tile and Scoreboards.\n\n2. Ready? Let your friends choose a team. Each team can have up to five players. Then click the Counter\nto start!\n \n3. To place a Snowball, double click on the tile that you are standing on, or double click on a tile next to you. Blow up Blocks for power-ups!\n\n4. Last team standing wins!\n\n\n\n\nRemember: You will be warped to an Exit Tile when you lose all your lives.','',0,''),(229,8,'club_shop','Club Shop','default_3x3',1,214,1,3,'1','1','0','0','catalog_header_hc','teaser_habboclub','','','','','',0,''),(230,680,'epic_pet','Epic Pet','default_3x3',1,42,4,8,'1','1','0','0','','','','Once purchased and placed, clicking it will give you a special pet.','','','',0,''),(231,604,'wall_decorations','Wall decorations','default_3x3',1,219,1,7,'1','1','0','0','catalog_gallery_headline1','catalog_posters_teaser1','','Adorn your walls with wondrous works of art, posters, plaques and wall hangings. The Gallery is bursting with items to suit all tastes, from kitsch to cool, traditional to modern.','','','',0,''),(102,277,'velociraptor','Velociraptor Pet','single_bundle',1,260,1,3,'1','1','0','0','jurassic15_catalog_header','dino_pets','','Swift and