  `subscription_type` varchar(255) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL COMMENT 'hc for Habbo Club, bc for Builders Club',
  PRIMARY KEY (`item_id`) USING BTREE,
  UNIQUE KEY `id` (`item_id`) USING BTREE,
  KEY `data` (`count`,`prizes`,`achievement_tick`,`achievement_cracked`) USING BTREE
